    "narrative-report-for-ottawa-national-wildlife-refuge-cedar-point-national-wildlife-refuge--44aff",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Ottawa,
    Cedar Point, and West Sister Island National Wildlife Refuges outlines Refuge accomplishments
    during the 1971 calendar year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, collections and
    receipts, and vegetation control. Resource management is outlined; topics include
    fur harvesting. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, violations, and safety. N-R
    forms, items of interest, and photographs are attached.",nt"license_title":
